oci\",\n            \"domain_tags\" : [\n                              \"transparència\",\n                              \"actes\",\n                              \"activitats\",\n                              \"agenda\"\n                            ],\n            \"domain_metadata\" :\n              [ { \"key\" : \"Actualització_Periodicitat\", \"value\" : \"Diari\" } ]\n          },\n        \"metadata\" :\n          {\n            \"domain\" : \"opendata.l-h.cat\",\n            \"license\" : \"Creative Commons Attribution 4.0 International\"\n          },\n        \"permalink\" : \"https://opendata.l-h.cat/d/qtv3-9x52\",\n        \"link\" : \"https://opendata.l-h.cat/Cultura-i-oci/Agenda-de-la-ciutat/qtv3-9x52\",\n        \"owner\" :\n          {\n            \"id\" : \"5ged-3nbm\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"Dades Obertes de L'Hospitalet\"\n          },\n        \"creator\" :\n          {\n            \"id\" : \"5ged-3nbm\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"Dades Obertes de L'Hospitalet\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Registre de casos de COVID-19 a Catalunya per municipi i sexe\",\n            \"id\" : \"jj6z-iyrp\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"El Departament de Salut ha deixat d'actualitzar aquest conjunt de dades en data 26-7-22. Podeu trobar tota la informació relacionada amb la COVID-19 i la resta d'infeccions respiratòries en els conjunts de dades de SIVIC (Vegeu contingut destacat).\\n\\n\\nAVÍS : a partir del 17 de juny de 2021 s'introdueix en aquest conjunt de dades el canvi que es descriu al final del text.\\n\\n\\nAquestes dades provenen de diversos sistemes d'informació del Departament de Salut i del Servei Català de la Salut, detallats a https://dadescovid.cat/documentacio , i mostren per a cada dia, municipi, sexe i procediment diagnòstic el nombre de casos identificats com a positius mitjançant alguna prova diagnòstica o per estudi epidemiològic; el procediment diagnòstic s'especifica en la variable 'TipusCasDescripcio', i la data del cas és la data d’inici de símptomes, no la data de realització de la prova diagnòstica. Tots ells són casos activats pels serveis de vigilància epidemiològica.\\n\\nEn els casos en què no ha estat possible identificar el municipi de residència de la persona identificada com a cas positiu, el valor de la variable 'MunicipiDescripcio' és 'No classificat'. I en els casos de persones residents en municipis amb una població inferior a 200 habitants, per evitar la seva identificació i garantir-ne la confidencialitat, en la variable 'MunicipiDescripcio' s'hi fa constar el valor '(Altres municipis)'.\\n\\n\\nCANVI APLICAT EL 17-06-2021 : ELIMINACIÓ DELS CASOS SEROLÒGICS POST-VACUNALS\\n\\nAmb l'actualització d'avui s'introdueix un canvi en el criteri de definició dels casos serològics, que són aquells diagnosticats per un resultat positiu en una prova d'ELISA o un test ràpid d'anticossos. (Corresponen als registres on la variable \\\"TipusCasDescripció\\\" pren els valors \\\"Positiu per ELISA\\\" o \\\"Positiu per Test Ràpid\\\".)\\n\\nAquestes dues proves detecten els anticossos contra la COVID-19, de tal manera que indiquen que la persona ja ha superat la infecció (no són casos actius sinó antics). Per aquest motiu no s'han utilitzat mai a https://dadescovid.cat per fer el seguiment de l'evolució de l'epidèmia ni es tenen en compte en els càlculs dels indicadors epidemiològics (IA7, IA14, Rt, RR, positivitat, etc). Les proves d'anticossos resulten positives en les persones que ja han passat la infecció però també en aquelles que han sigut vacunades.\\n\\nPer aquest motiu, a partir d'avui no es consideraran com a casos aquells resultats positius a una prova ELISA o un test ràpid d'anticossos que s'hagin realitzat amb posterioritat a l'administració de la primera dosi de la vacuna contra el SARS-CoV-2.\\n\\nS'actualitzen també les dades prèviament publicades en aquest conjunt de dades per aplicar aquest mateix criteri a tota la sèria històrica.\",\n            \"attribution\" : \"Departament de Salut\",\n            \"attribution_link\" : \"https://administraciodigital.gencat.cat/ca/dades/dades-obertes/informacio-practica/llicencies/\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-04-07T10:27:06.000Z\",\n            \"createdAt\" : \"2020-03-31T07:15:24.000Z\",\n            \"metadata_updated_at\" : \"2025-04-07T10:27:06.000Z\",\n            \"data_updated_at\" : \"2023-03-17T13:06:11.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 35,\n                \"page_views_last_month\" : 202,\n                \"page_views_total\" : 267749,\n                \"page_views_last_week_log\" : 5.169925001442312,\n                \"page_views_last_month_log\" : 7.6653359171851765,\n                \"page_views_total_log\" : 18.030527049412342\n              },\n            \"columns_name\" :\n              [\n                \"TipusCasData\",\n                \"NumCasos\",\n                \"ComarcaDescripcio\",\n                \"ComarcaCodi\",\n                \"SexeDescripcio\",\n                \"TipusCasDescripcio\",\n                \"SexeCodi\",\n                \"MunicipiCodi\",\n                \"DistricteDescripcio\",\n                \"DistricteCodi\",\n                \"MunicipiDescripcio\"\n              ],\n            \"columns_field_name\" :\n              [\n                \"data\",\n                \"numcasos\",\n                \"comarcadescripcio\",\n                \"comarcacodi\",\n                \"sexedescripcio\",\n                \"resultatcoviddescripcio\",\n                \"sexecodi\",\n                \"municipicodi\",\n                \"districtedescripcio\",\n              